import React from "react";
import classes from "./Cell.module.css";
import { TETROMINOS } from "../../tetrominos";

const Cell = (props) => (
  <div
    className={classes.Cell}
    type={"L"}
    style={{
      backgroundColor: `${TETROMINOS["L"].color}`,
      border: `${TETROMINOS[0] === 0 ? "0px solid" : "1px solid"}`,
      padding: "12px",
      boxShadow: "5px 10px",
    }}
  ></div>
);

export default Cell;
